import React from 'react'

export default class CharacterCreater extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      initiative: null,
      dexterity: null,
      name: null,
      portrait: null,
    }
  }

  render(){
    return(
      <div>
        <div>Name:</div><input type="text" name="name"/>
        <div>Initiative:</div><input type="text" name="Initiative"/>

        Dexterity:
        <input type="text" name="Dexterity"/>

        Portrait:
        <input type="text" name="Portrait"/>
      </div>
    )
  }
}
